insert  into `devfaulttype`(`id`,`faultType`,`faultDesc`,`faultDealInfo`) values (1,0,'无故障',''),(2,1,'接触器断开故障','序号		故障原因 		判定方法及思路 							解决办法\r\n1 		接触器线圈坏 		→ 测试线圈电阻							→ 更换接触器线圈\r\n						→测试接触器的辅助接点是否连接可靠			→更换接触器辅助接点\r\n						→有普通线圈和AC吸合DC保持线圈				→ 更换接触器\r\n						→ 线圈压按螺丝松动\r\n\r\n2 		接触器内部有异物	→ 环境过脏								→ 提供良好环境\r\n						→ 尘埃可能与接触器衔铁的油结合形成			→ 清理接触器衔铁的油、污\r\n						导致接触器不能吸合或振荡的污泥层			→ 清理接触器衔铁中间的杂质\r\n						→ 大型的颗粒或其他东西掉入接触器内部，\r\n						导致接触器不能吸合，\r\n						长期可导致接触器线圈烧坏\r\n\r\n3 		电容器充电限		→ 电容无法充电至额定值，					→ 更换限流电阻\r\n		流电阻坏			控制接触器线圈的小继电器无法吸合			→ 加大限流电阻的容量\r\n						→测量限流电阻阻值							\r\n			\r\n4 		控制接触器线圈 	→ 线圈坏									→更换控制接触器线圈的小继电器\r\n		的小继电器坏		→ 触点烧坏，一直处于断开状态\r\n\r\n\r\n\r\n5 		接触器状态判定	→ 接触器辅助触点烧坏，接触器动				→ 更换接触器\r\n		的一对触点		作，但辅助触点一直处于常闭状态				→ 更换接触器的辅助触点\r\n		(现为常闭）\r\n		烧结不能分离。\r\n\r\n'),(3,2,'温度传感器过热故障','111没有'),(4,3,'过电压故障','111没有'),(5,4,'欠电压故障','111过电压故障'),(6,5,'温度继电器过热故障','111过电压故障'),(7,6,'位置传感器故障','111过电压故障'),(8,7,'存储器故障','111过电压故障'),(9,8,'过载故障','111过电压故障'),(10,9,'A相电流异常','testtesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttest\r\ntesttesttesttesttesttest\r\ntest\r\ntest\r\ntesttesttesttesttesttesttesttesttest\r\ntesttesttesttesttest\r\n\r\n\r\ntesttesttesttesttesttesttesttesttesttesttesttesttesttest\r\n\r\n\r\ntesttesttesttesttest\r\n\r\n\r\ntesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttest\r\n\r\n\r\ntesttesttesttesttesttesttesttesttesttesttesttesttesttesttest'),(11,10,'B相电流异常','<?xml version=\"1.0\" standalone=\"yes\"?>\r\n<DEV_CONFIG>\r\n<DEV_TYPE>0</DEV_TYPE>\r\n<DEV_DESC>压砖机</DEV_DESC>\r\n<CYCLE_CMD>\r\n<CMD>\r\n<ADDRESS>7680</ADDRESS>\r\n<LENGTH>10</LENGTH>\r\n</CMD>\r\n<CMD>\r\n<ADDRESS>36880</ADDRESS>\r\n<LENGTH>1</LENGTH>\r\n</CMD>\r\n<CMD>\r\n<ADDRESS>6140</ADDRESS>\r\n<LENGTH>1<